import React from 'react'

const Movie = (props) => {
  return (
    <div className='movie'> 
        <img src={props.img} alt='test' />
        <p>Title:{props.title}</p>
        <p>Year:{props.year}</p>
    {props.title}</div>
  )
}

export default Movie
